import React from "react";

export default function Header() {
  return (
    <div className="flex fixed top-0 w-full bg-[#8173B2] text-white">
      <div className="flex-1"></div>
      <div className="flex-1 m-4 lg:m-0 justify-end items-center">
        <ul className="flex flex-col mt-4 font-medium lg:flex-row lg:space-x-8 lg:mt-0 items-center justify-center">
          <li><a href="#">Home</a></li>
          <li><a href="#">About Us</a></li>
          <li><a href="#">Portfolio</a></li>
          <li><a href="#">Contact</a></li>
        </ul>
      </div>
    </div>
  );
}
